import NavBar from '../navbar/NavBar';
import './Header.css'

function Header() {
    return (
      <div className="Header">
        <div className='navbar'>
            <NavBar/>
        </div>
        <div className="main-header">
          <div className='main-section'>
            <h1 className='text-title'>HOLA! SOY DESARROLLADOR WEB</h1>
          </div>
            
        </div>
      </div>
    );
  }

export default Header;
